Penyusunan dokumen Peraturan Daerah tentang Pertanggungjawaban Pelaksanaan APBD merupakan tahapan penting dalam siklus pengelolaan keuangan daerah. Dokumen ini memuat laporan realisasi anggaran, laporan keuangan yang telah diaudit oleh Badan Pemeriksa Keuangan (BPK), serta informasi lainnya yang mencerminkan kinerja keuangan Pemerintah Daerah selama satu tahun anggaran. Dasar hukum penyusunan Perda ini antara lain:
Undang-Undang Nomor 23 Tahun 2014 tentang Pemerintahan Daerah;
Undang-Undang Nomor 17 Tahun 2003 tentang Keuangan Negara;
Peraturan Pemerintah Nomor 12 Tahun 2019 tentang Pengelolaan Keuangan Daerah;
Permendagri Nomor 77 Tahun 2020 tentang Pedoman Teknis Pengelolaan Keuangan Daerah.
